import React, { Component } from 'react'

export default class Task extends Component {

    constructor(props){
        super(props)

        console.log(props);

    }

    render() {
        return (

            <article className={`task shadow-out ${this.props.bg}`}>
                <p className='task-title m-0'>
                    {this.props.title}
                    <span className='task-iconbox ml-4'>
                        <i className="fa fa-check mr-2 pointer check-icon" onClick={this.props.isChecked}></i>
                        <i className="fa fa-trash pointer delete-icon" onClick={this.props}></i>
                    </span>
                </p>
            </article>

        )
    }
}
